【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 直線噴射距離90センチ、超強力ショットスチーム。シワをいっきにほぐす。<br />独自開発の気化室機構により、圧力を極限まで高めた超強力ショットスチームを実現。強力スチームが生地の奥まで素早く浸透し、シワの原因となる繊維の絡まりを一気にほぐします。<br /><br />★ 加熱時間80秒、スチーム持続時間150秒。素早く立ち上がり、長く使える。<br />一般的なコードレスアイロンには「素早い立ち上がり」と「長いスチーム持続時間」が両立できないというデメリットがあります。当社が長年培ってきた電熱応用ノウハウを元に、構造的・性能的な微調整を繰り返した末、双方を兼ね備えた絶妙な機能バランスを実現しました。<br /><br />★ ほどよい重みの極厚掛け面とセラミックコーティングで、快適プレス体験。<br />極厚掛け面は、一度アイロンを掛ければ十分にシワが伸びる適度な重み。上から手で押さえる力が最小限に抑えられるので、腕にかかる余計な負担を減らします。また、高品質なセラミックコーティングを採用し、掛け面の滑りをよりスムーズにしました。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 定格:AC100V 50/60Hz 1420W<br />* 本体寸法:幅232×奥行111×高134mm/収納時・幅281×奥行178×高203mm<br />* 本体質量:約1.1kg/収納時・約2.2kg<br />* コード長:1.6m <br />* 蒸気発生方式:滴下式<br />* タンク容量:約200ml<br />* 温度調節器:約120～200℃(マイコン式)<br />* 安全装置:温度ヒューズ/240℃・オートパワーオフ機能<br />* 材質表示:本体・PC樹脂/ベース・アルミダイキャスト/ベース面・セラミックコーティング/スタンドカバー・PP樹脂<br />* 付属品:給水カップ(200ml)</p></div><!-- 商品仕様 ここまで --><style>

